  return (
    <>
      <Link to={`/browse/${props.slug.toLowerCase()}`}>
        <button
          type="button"
          className="category-list"
          onClick={() => console.log('clicked')}
        >
          {props.name}
        </button>
      </Link>
    </>
  );
}
